import React, { useState, useEffect, useRef } from 'react';
import { FiSearch, FiChevronDown, FiX } from 'react-icons/fi';
import { VehicleModel } from '../../types';
import { dataService } from '../../services/dataService';
import * as S from './VehicleModelSearchDropdown.styles';

interface VehicleModelSearchDropdownProps {
  value?: VehicleModel | null;
  onChange: (model: VehicleModel | null) => void;
  placeholder?: string;
  hasError?: boolean;
  disabled?: boolean;
}

const VehicleModelSearchDropdown: React.FC<VehicleModelSearchDropdownProps> = ({
  value,
  onChange,
  placeholder = "Search for vehicle model...",
  hasError = false,
  disabled = false
}) => {
  const [isOpen, setIsOpen] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const [options, setOptions] = useState<VehicleModel[]>([]);
  const [isLoading, setIsLoading] = useState(false);
  const [hasSearched, setHasSearched] = useState(false);

  const dropdownRef = useRef<HTMLDivElement>(null);
  const inputRef = useRef<HTMLInputElement>(null);

  // Close dropdown when clicking outside
  useEffect(() => {
    const handleClickOutside = (event: MouseEvent) => {
      if (dropdownRef.current && !dropdownRef.current.contains(event.target as Node)) {
        setIsOpen(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => document.removeEventListener('mousedown', handleClickOutside);
  }, []);

  // Search for vehicle models with debouncing
  useEffect(() => {
    if (!searchTerm.trim()) {
      setOptions([]);
      setHasSearched(false);
      return;
    }

    const searchTimeout = setTimeout(async () => {
      setIsLoading(true);
      try {
        const results = await dataService.searchVehicleModels(searchTerm);
        setOptions(results);
        setHasSearched(true);
      } catch (error) {
        console.error('Error searching vehicle models:', error);
        setOptions([]);
      } finally {
        setIsLoading(false);
      }
    }, 300); // 300ms debounce

    return () => clearTimeout(searchTimeout);
  }, [searchTerm]);

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const newSearchTerm = e.target.value;
    setSearchTerm(newSearchTerm);

    if (!isOpen) {
      setIsOpen(true);
    }
  };

  const handleOptionSelect = (model: VehicleModel) => {
    onChange(model);
    setSearchTerm('');
    setIsOpen(false);
  };

  const handleClear = () => {
    onChange(null);
    setSearchTerm('');
    setOptions([]);
    setHasSearched(false);
    setIsOpen(false);
  };

  const handleInputFocus = () => {
    if (!disabled) {
      setIsOpen(true);
    }
  };

  const displayValue = value ? `${value.make} ${value.manufacturer} ${value.year}` : '';

  return (
    <S.DropdownContainer ref={dropdownRef}>
      <S.DropdownInput
        ref={inputRef}
        type="text"
        value={isOpen ? searchTerm : displayValue}
        onChange={handleInputChange}
        onFocus={handleInputFocus}
        placeholder={placeholder}
        hasError={hasError}
        disabled={disabled}
      />
      <S.SearchIcon>
        <FiSearch size={16} />
      </S.SearchIcon>

      {value && !isOpen && (
        <S.ClearButton onClick={handleClear} type="button">
          <FiX size={16} />
        </S.ClearButton>
      )}

      {!value && !isOpen && (
        <S.DropdownButton onClick={() => setIsOpen(true)} disabled={disabled}>
          <FiChevronDown size={16} />
        </S.DropdownButton>
      )}

      {isOpen && (
        <S.DropdownList>
          {isLoading ? (
            <S.LoadingSpinner>
              <div className="spinner" />
              Searching...
            </S.LoadingSpinner>
          ) : options.length > 0 ? (
            options.map((model) => (
              <S.DropdownItem
                key={model.id}
                onClick={() => handleOptionSelect(model)}
              >
                <div className="model-info">
                  <div className="model-name">
                    {model.make} {model.manufacturer}
                  </div>
                  <div className="model-details">
                    Year: {model.year} | Capacity: {model.capacity}
                  </div>
                </div>
              </S.DropdownItem>
            ))
          ) : hasSearched ? (
            <S.NoResultsMessage>
              No vehicle models found for "{searchTerm}"
            </S.NoResultsMessage>
          ) : (
            <S.NoResultsMessage>
              Start typing to search for vehicle models
            </S.NoResultsMessage>
          )}
        </S.DropdownList>
      )}
    </S.DropdownContainer>
  );
};

export default VehicleModelSearchDropdown;
